style.css:
@-moz-document domain("www.roblox.com"), domain("robloxlabs.com"), domain("wiki.roblox.com"), domain("devforum.roblox.com")
{
  *
  {
    font-family: "stereofidelic" !important;
  }

  .logo-big
  {
    display: block;
    -moz-box-sizing: border-box;
    box-sizing: border-box;
    width: 125px;
    height: 40px;
    padding-left: 125px;
  }

  #site-logo.logo-big
  {
    background: url("https://i.pinimg.com/736x/af/a3/0d/afa30d10cf35f8ada4e2a00806e99176.jpg") no-repeat;
    background-size: 125px;
  }
}
